body:
If ES6 style import statement is used in .ts, an assertion expression is compiled to the format that is not supported by power-assert like `power_assert_1.default.ok()`.

For examlple,

``` ts
// original .ts
import assert from 'power-assert';
import sut from '../';

describe('foo', () => {
    it('test #1', () => {
        assert.ok(sut() === 2);
    });
});
```

is compiled to

``` js
// generated .js
var power_assert_1 = require('power-assert');
var _1 = require('../');
describe('foo', function () {
    it('test #1', function () {
        power_assert_1.default.ok(_1.default() === 2);
    });
});
```

To resolve this problem, this PR changes to use CommonJS Style default export simply.

Using some of the redux-router action creators like pushState :

```
import { pushState } from 'redux-router';

export function saveEngagementAsVisibleSuccess(goTo) {
    return function(dispatch) {
        dispatch(pushState(null, goTo));
    }
}
```

Throws the following error:

```
Error TS2349: Cannot invoke an expression whose type lacks a call signature.

```

The redux-router [source code](https://github.com/acdlite/redux-router/blob/master/src/actionCreators.js#L46-L63) declare those as functions not objects:

```
export function historyAPI(method) {
  return (...args) => ({
    type: HISTORY_API,
    payload: {
      method,
      args
    }
  });
}

export const pushState = historyAPI('pushState');
export const push = historyAPI('push');
export const replaceState = historyAPI('replaceState');
export const replace = historyAPI('replace');
export const setState = historyAPI('setState');
export const go = historyAPI('go');
export const goBack = historyAPI('goBack');
export const goForward = historyAPI('goForward');
```

So I have update the types from `__ReduxRouter.ReduxRouterAction` to `(...args: any[]) => __ReduxRouter.ReduxRouterAction`:

```
export const pushState: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const push: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const replaceState: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const replace: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const setState: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const go: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const goBack: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
export const goForward: (...args: any[]) => __ReduxRouter.ReduxRouterAction;
```

The previous [camelcase](https://github.com/sindresorhus/camelcase) definitions where not correct as `export default` assumes a `default` property in the exported object. Fixed by these changes.

Also added empty namespace because of https://github.com/Microsoft/TypeScript/issues/5073.

@sindresorhus Can you :+1: for me?

Updates to the sax type definitions to include the isSelfClosing attribute and to fix the fact that, when the xmlns option is enabled, the attributes property in the tag element is of type [key: string]: Attribute, being Attribute a similar interface to Tag.

As a consequence, the onopentag method is changed to onopentag(tag: Tag | QualifiedTag): void, where:

```
    interface Tag {
      name: string;
      isSelfClosing: boolean;
      attributes: { [key: string]: string };
    }

    interface QualifiedTag {
      name: string;
      prefix: string;
      local: string;
      uri: string;
      ns: { [key: string]: string };
      attributes: { [key: string]: Attribute };
    }

   interface Attribute {
      name: string;
      prefix: string;
      local: string;
      uri: string;
      value: string;
   }
```
